,p_javascript_file_urls=>'#PLUGIN_FILES#script#MIN#.js'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'function render (',
'    p_dynamic_action apex_plugin.t_dynamic_action,',
'    p_plugin         apex_plugin.t_plugin )',
'    return apex_plugin.t_dynamic_action_render_result',
'as',
'    l_result    apex_plugin.t_dynamic_action_render_result;',
'    l_json      sys.json_object_t := sys.json_object_t();',
'',
'    l_action               varchar2( 100 )  := p_dynamic_action.attribute_01;',
'    l_selection_state_item varchar2( 255 )  := p_dynamic_action.attribute_02;',
'    l_expression           varchar2( 4000 ) := nvl( p_dynamic_action.attribute_03, ''null'' );',
'    l_persist_selection    boolean          := nvl( p_dynamic_action.attribute_04, ''N'' ) = ''Y'';',
'    l_multiple_selection   boolean          := nvl( p_dynamic_action.attribute_05, ''N'' ) = ''Y'';',
'    l_hide_footer          boolean          := nvl( p_dynamic_action.attribute_06, ''N'' ) = ''Y'';',
'    l_expr_func            varchar2( 4000 );',
'begin',
'    l_json.put( ''action'',                 l_action );',
'    l_json.put( ''persistSelection'',       l_persist_selection );',
'    l_json.put( ''selectionStateItemName'', l_selection_state_item );',
'    l_json.put( ''multipleSelection'',      l_multiple_selection );',
'    l_json.put( ''hideFooter'',             l_hide_footer );',
'',
'    l_expr_func := apex_string.format(q''~',
'        function(){',
'            return %s;',
'        }~'',',
'        l_expression);',
'',
'    l_result.javascript_function := apex_string.format(q''~',
'        function() {',
'           interactiveGridUtils.run( this, %s, %s );',
'        }~'',',
'        l_json.to_string,',
'        l_expr_func);',
'',
'    return l_result;',
'end render;'))
,p_api_version=>1
,p_render_function=>'render'
,p_standard_attributes=>'REGION:REQUIRED'
,p_substitute_attributes=>true
,p_version_scn=>41963333655930
