prompt --application/deployment/install/install_packges
begin
wwv_flow_imp_shared.create_install_script(
 p_id=>wwv_flow_imp.id(15442806355151828502)
,p_install_id=>wwv_flow_imp.id(29716233622583107497)
,p_name=>'Packges'
,p_sequence=>30
,p_script_type=>'INSTALL'
,p_script_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'create or replace package eba_demo_jkday is ',
'    function is_even(p_int_value in pls_integer) ',
'    return boolean;',
'    procedure show_insurance_for_model(',
'        p_model_id           in number,',
'        p_display           out varchar2,',
'        p_default_insurance out number);',
'end eba_demo_jkday;',
'/',
'create or replace package body eba_demo_jkday is ',
'    function is_even(p_int_value in pls_integer) ',
'    return boolean',
'    is',
'    begin',
'        return mod(p_int_value,2) = 0;',
'    end is_even;',
'',
'procedure show_insurance_for_model(',
'    p_model_id           in number,',
'    p_display           out varchar2,',
'    p_default_insurance out number)',
'is',
'begin',
'    -- Default to not displaying insurance',
'    p_display := ''N'';',
'    if p_model_id is not null then',
'        -- Return ''Y'' if model price over 25000',
'        select case ',
'                  when retail_price > 25000',
'                  then ''Y''',
'                  else ''N''',
'               end,',
'               round(retail_price * 0.02)',
'        into p_display,',
'             p_default_insurance',
'        from eba_demo_auto_model',
'       where id = p_model_id;',
'   end if;',
'exception',
'    when no_data_found then',
'        null;',
'end show_insurance_for_model;',
'end eba_demo_jkday;',
'/'))
);
wwv_flow_imp_shared.create_install_object(
 p_id=>wwv_flow_imp.id(15789079509115385435)
,p_script_id=>wwv_flow_imp.id(15442806355151828502)
,p_object_owner=>'#OWNER#'
,p_object_type=>'PACKAGE'
,p_object_name=>'EBA_DEMO_JKDAY'
);
end;
